import React from 'react';
import { FaBriefcase, FaEnvelope, FaGraduationCap, FaHome, FaUser } from 'react-icons/fa';
import './Style.css';

class NavigationItems extends React.Component {

    render() {
        return (
            <ul className="navigation" id="nav_items">
                <li><FaHome size={32} color={"#2c4269"}/></li>
                <li><FaUser size={32} color={"#2c4269"}/></li>
                <li><FaGraduationCap size={32} color={"#2c4269"}/></li>
                <li><FaBriefcase size={32} color={"#2c4269"}/></li>
                <li><FaEnvelope size={32} color={"#2c4269"}/></li>
            </ul>   
            
        );
    }
}

export default NavigationItems;
